import { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { fetchMatches } from '../services/requestService';
import { Card, Typography } from '@mui/material';

const MatchesPage = () => {
  const dispatch = useDispatch();
  const  matches  = useSelector(state => state.reqs.matches);

  useEffect(() => {
    dispatch(fetchMatches());
  }, [dispatch]);

  console.log(matches);

  return (
    <>
      <Typography variant="h4" gutterBottom>Your Matches</Typography>
      {/* {loading && <p>Loading...</p>} */}
      {matches?.map(match => (
        <Card key={match.id} sx={{ p: 2, mb: 2 }}>
            {console.log(match)}
          <Typography>{match.fromUser.full_name}</Typography>
          <Typography>{match.fromUser.full_name}</Typography>
          {/* Optionally show contact, common languages, etc */}    
        </Card>
      ))}
    </>
  );
};

export default MatchesPage;
